import React from 'react'

function ContactCard() {
  return (
    <div className="contact-card">
      <img src="http://placekitten.com/300/200" alt="kitten"/>
      <h3>Mr. Whiskerson</h3>
      <p>Phone: (212) 555-1234</p>
      <p>Email: mr.whiskaz@catnap.meow</p>
    </div>
  )
}

export default ContactCard
